# 論理演算の木を構築 (再帰的に部分式も解析)
#------------------------------------------------------------------------------
sub _build_logic_tree { my ($self, $op) = @_; my $name = $op->name; my $info = $LOGIC_OPS{$name} or return; my $left_op = $op->first; return unless $left_op && !$left_op->isa('B::NULL'); my $right_op = $left_op->sibling; return unless $right_op && !$right_op->isa('B::NULL'); # 左辺と右辺を再帰的に解析 my $left = $self->_analyze_operand($left_op); my $right = $self->_analyze_operand($right_op); return LogicNode->new( type => $name, op => $info->{symbol}, short_circuit => $info->{short_circuit}, left => $left, right => $right, right_const => $self->_is_constant($right_op), );
