#------------------------------------------------------------------------------
sub _analyze_operand { my ($self, $op) = @_; return '' unless $op && !$op->isa('B::NULL'); my $name = $op->name; # 論理演算子なら再帰的に木を構築 if (exists $LOGIC_OPS{$name}) { return $self->_build_logic_tree($op); } # null OP の場合は中身を見る if ($name eq 'null') { my $first = $op->first; if ($first && !$first->isa('B::NULL')) { my $inner_name = $first->name; if (exists $LOGIC_OPS{$inner_name}) { return $self->_build_logic_tree($first); } } } # 葉ノード: deparse してテキストを取得 return LogicNode->new( type => 'leaf', text => $self->_deparse_simple($op), );
