sub _deparse_simple { my ($self, $op) = @_; return '' unless $op && !$op->isa('B::NULL'); local $@; my $text = eval { $self->{deparse}->deparse($op, 0) }; return $text // '' if $@; # 後処理 $text =~ s/^\s+//; $text =~ s/\s+$//; return $text;
