sub generate { my ($class, $node) = @_; return [] unless $node; if ($node->is_leaf) { return $class->_leaf_table($node); } my $type = $node->type; if ($type eq 'cond_expr') { return $class->_cond_table($node); } # 左右のオペランドの変数を収集 my @vars = $class->_collect_variables($node); # 左右が複合式かどうかで分岐 my $left_complex = ref($node->left) && !$node->left->is_leaf; my $right_complex = ref($node->right) && !$node->right->is_leaf; if ($left_complex || $right_complex) { return $class->_complex_table($node, \@vars); } return $class->_simple_table($node);
