sub _complex_table { my ($class, $node, $vars) = @_; # 全変数の組み合わせを生成 my $n = @$vars; my @table; for my $i (0 .. (2**$n - 1)) { my %vals; for my $j (0 .. $n-1) { $vals{$vars->[$j]} = ($i >> ($n - 1 - $j)) & 1; } my $result = $class->_evaluate($node, \%vals); my @inputs = map { $vals{$_} } @$vars; push @table, { inputs => \@inputs, result => $result, vals => \%vals, }; } return { expression => $class->_node_to_expr($node), variables => $vars, headers => [map { s/^\$//r } @$vars], rows => \@table, };
