sub _evaluate { my ($class, $node, $vals) = @_; return 0 unless $node; if ($node->is_leaf) { my $text = $node->text; # $var 形式を探して値を返す if ($text =~ /^\$(\w+)$/) { return $vals->{$text} // 0; } # 定数として評価 return $text ? 1 : 0; } my $type = $node->type; my $left_val = $class->_evaluate($node->left, $vals); my $right_val = $class->_evaluate($node->right, $vals); if ($type =~ /^(?:and|andassign)$/) { return $left_val && $right_val ? 1 : 0; } elsif ($type =~ /^(?:or|orassign|dor|dorassign)$/) { return $left_val || $right_val ? 1 : 0; } elsif ($type eq 'xor') { return ($left_val xor $right_val) ? 1 : 0; } elsif ($type eq 'cond_expr') { my $cond_val = $class->_evaluate($node->{condition}, $vals); return $cond_val ? $left_val : $right_val; } return 0;
